import axios from 'axios';
import { useState } from 'react';
import CsvDownloadButton from 'react-json-to-csv';

function EmployeeRegistration() {

    const [name, setName] = useState('');
    const [address, setAddress] = useState('');
    const [mobile, setMobile] = useState('');

    async function save(event) {
        event.preventDefault();
        try {
            await axios.post("http://localhost:8085/api/v1/emp",
                {
                    employeeName: name,
                    employeeAddress: address,
                    mobile: mobile
                });
            alert("Employee Registration Successfull");
            setName("");
            setAddress("");
            setMobile("");
        }
        catch (err) {
            alert("Employee Registration Failed");
        }
    }

    return (
        <div className="container mt-4">
            <form>
                <div className="form-group">
                    <label> Name </label>
                    <input type="text" className="form-control" placeholder="Enter Name"
                        value={name}
                        onChange={(event) => {
                            setName(event.target.value);
                        }}
                    />
                </div>

                <div className="form-group">
                    <label> Address </label>
                    <input type="email" className="form-control" placeholder="Enter Address"
                        value={address}
                        onChange={(event) => {
                            setAddress(event.target.value);
                        }}
                    />
                </div>

                <div className="form-group">
                    <label> Mobile </label>
                    <input type="text" className="form-control" placeholder="Enter Mobile"
                        value={mobile}
                        onChange={(event) => {
                            setMobile(event.target.value);
                        }}
                    />
                </div>

                <button className="btn btn-primary mt-4" onClick={save}> Register </button>
            </form>

            <CsvDownloadButton>
                Good Data
            </CsvDownloadButton>
        </div>
    );
}

export default EmployeeRegistration;
